#include <iostream>#include <cstring>int main() {	int n;	std::cin >> n;	while (n--) {		char str2[100001];		int cnt[100] = { 0, };		scanf("%s", str2);		bool result = true;		int t = strlen(str2);		for (int i = 0; i<t; i++) {			if (++cnt[str2[i]]  % 3 == 0){				if (str2[i + 1] != str2[i++]) {					result = false;				}			}		}		if (result) std::cout << "OK\n";		else std::cout << "FAKE\n";	}}